package com.example.awash.Config.Serviceimport com.example.awash.Config.Models.Lavageimport retrofit2.Callimport retrofit2.http.GETimport retrofit2.http.Queryinterface LavageService {    @GET("/client/lavages/aproximity")    fun getNearbyLavages(        @Query("latitude") latitude: Double,        @Query("longitude") longitude: Double,        @Query("radius") radius: Int,    ): Call<List<Lavage>>}